import React, { useState } from 'react';
import 'react-bootstrap-range-slider/dist/react-bootstrap-range-slider.css';
import RangeSlider from 'react-bootstrap-range-slider';

// import './ConfRate.css';

// we can use hooks instead of creating a class with new React JS 
const ConfRate = () => {

const [ value, setValue ] = useState(0); // initial position of the slide: should be a random value between 50 and 100  

    return ( 
    <div>     
      <RangeSlider 
        value   ={value}
        min     = {50}
        max     = {100}
        step    = {1}
        disabled = {false} 
        size     = {'sm'}
        variant  = {'primary'}
        tooltip  = {'auto'}

        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      </div>

    );
  }


export default ConfRate;
